-- Create tables

-- SIoT Dispatch
CREATE TABLE `siot_dispatch` (
	`ID`	BIGINT,
	`TIME`	DATETIME,
	`cmd`	TEXT
);

COMMIT;

-- SIoT Driver stats
CREATE TABLE `siot_driver_stats` (
	`ID`	BIGINT,
	`TIME`	DATETIME,
	`ACKCount`	FLOAT,
	`ACKWaiting`	FLOAT,
	`CANCount`	FLOAT,
	`NAKCount`	FLOAT,
	`OOFCount`	FLOAT,
	`SOFCount`	FLOAT,
	`badChecksum`	FLOAT,
	`badroutes`	FLOAT,
	`broadcastReadCount`	FLOAT,
	`broadcastWriteCount`	FLOAT,
	`callbacks`	FLOAT,
	`dropped`	FLOAT,
	`netBusy`	FLOAT,
	`noACK`	FLOAT,
	`nonDelivery`	FLOAT,
	`notIdle`	FLOAT,
	`readAborts`	FLOAT,
	`readCount`	FLOAT,
	`retries`	FLOAT,
	`routedBusy`	FLOAT,
	`writeCount`	FLOAT
);

COMMIT;

-- SIoT Export
CREATE TABLE `siot_export` (
	`ID`	BIGINT,
	`TIME`	DATETIME,
	`VALUE`	FLOAT
);

COMMIT;

-- SIoT HCI Stats
CREATE TABLE `siot_hci_stats` (
	`ID`	BIGINT,
	`TIME`	DATETIME,
	`aclPackets`	FLOAT,
	`address`	FLOAT,
	`rxAcls`	FLOAT,
	`rxBytes`	FLOAT,
	`rxErrors`	FLOAT,
	`rxEvents`	FLOAT,
	`rxScos`	FLOAT,
	`scoMtu`	FLOAT,
	`scoPackets`	FLOAT,
	`txAcls`	FLOAT,
	`txBytes`	FLOAT,
	`txCmds`	FLOAT,
	`txErrors`	FLOAT,
	`txScos`	FLOAT
);

COMMIT;

-- SIoT Node Stats
CREATE TABLE `siot_node_stats` (
	`ID`	BIGINT,
	`TIME`	DATETIME,
	`averageRequestRTT`	FLOAT,
	`averageResponseRTT`	FLOAT,
	`lastRequestRTT`	FLOAT,
	`lastResponseRTT`	FLOAT,
	`quality`	FLOAT,
	`receiveDuplications`	FLOAT,
	`receiveUnsolicited`	FLOAT,
	`receivedCount`	FLOAT,
	`sentCount`	FLOAT,
	`sentFailed`	FLOAT
);

COMMIT;

-- SIoT Notification
CREATE TABLE `siot_notification` (
	`TIME`	DATETIME,
	`ID`	BIGINT,
	`homeID`	FLOAT,
	`nodeID`	FLOAT,
	`GENRE`	FLOAT,
	`CMDCLASS`	FLOAT,
	`INSTANCE`	FLOAT,
	`VAL_INDEX`	FLOAT,
	`TYPE`	FLOAT,
	`BYTE`	FLOAT
);

COMMIT;

-- SIoT LoRa
CREATE TABLE `siot_lora` (
  `SIZE` INT,
  `SF` INT,
  `BAD_WIDTH` INT,
  `CODE_RATE` INT,
  `TIMESTAMP` BIGINT,
  `PHY_PAYLOAD` TEXT,
  `RSSI` FLOAT
);

COMMIT;

-- SIoT LoRa Airtime
CREATE TABLE `siot_lora_airtime` (
  `DEV_ADDR` TEXT,
  `AIR_TIME` BIGINT,
  `TIMESTAMP` BIGINT,
  `PHY_PAYLOAD` TEXT
);

COMMIT;

-- SIoT LoRa Distance 
CREATE TABLE `siot_lora_distance` (
  `DEV_ADDR` TEXT,
  `TIMESTAMP` BIGINT,
  `BASE_RSSI` FLOAT,
  `RSSI` FLOAT,
  `VARIANCE` FLOAT
);

COMMIT;

-- SIoT LoRa Replay 
CREATE TABLE `siot_lora_replay` (
  `DEV_ADDR` TEXT,
  `TIMESTAMP` BIGINT,
  `FCNT` TEXT
);

COMMIT;

